import React from "react";
import { Route, Switch } from "react-router-dom";
import Home from "./Home";
import "tailwindcss/tailwind.css";

const App = () => (
  <Switch>
    <Route exact path="/">
      home
    </Route>
  </Switch>
);

export default App;
